import React from "react";


function Calendar(){


  var gapi = window.gapi 
  var CLIENT_ID = "522511030691-750ctiv2ds34dv9hdvu7lpeecif1rgmj.apps.googleusercontent.com"
  var API_KEY = "AIzaSyB1UAKnMOTSJYBq-eUVZgve6ktjQNd0Yes"
  var DISCOVERY_DOCS = ["https://www.googleapis.com/discovery/v1/apis/calendar/v3/rest"]
  var SCOPES = "https://www.googleapis.com/auth/calendar.events"

    function handleClick(){
        gapi.load('client:auth2', () => {
            console.log('loaded client')

            gapi.client.init({
                apiKey: API_KEY,
                clientId: CLIENT_ID,
                discoveryDocs: DISCOVERY_DOCS,
                scope: SCOPES,
              })

              gapi.client.load('calendar', 'v3', () => console.log('bam!'))
              gapi.auth2.getAuthInstance().signIn()


    })
}

    return(
        <>
        <button  type="button" className="btn btn-success" onClick={handleClick}>SET REMINDER</button>        

        </>
    )
}
export default Calendar;
